import React from "react";
// import Navbar from "components/Navbar.js";
import Daycard from "components/Daycard.js";
import {cities, forcast} from '../components/dummyData'


export default class Profile extends React.Component{
  constructor () {
    super();
    this.state = {
      citylist: []
  }
  }


//change this to fetch from favorites DB 
componentDidMount(){
    // this.setState({suggestions:cities});
    fetch('http://localhost:9000/profile')
    .then(res => res.json())
    .then(data => { 
      console.log(data);
      this.setState({citylist:data});
    })
    .catch(err => {
      console.log(err);
    })
  }

  renderCities = (props) =>{
    const {citylist} = this.state;
    return (
      <ul>
        {
          citylist.map(item => {
            return <div>
                    <li>
                      {item.city_key}
                    </li>
            </div>
          })
        }
      </ul>
    )
  }


  render() {
    return (
      <div>
        <h1>my Favorites page</h1>
      </div>
    )
  }
}
